import Axiosinstance from '../../config/Axiosinstances'
import { useNavigate } from 'react-router-dom'
import ButtonList from './buttons'

function Mybooking() {
   const [bokings, setBokings] = useState([])
   const navigate=useNavigate()

    useEffect(() => {
      getMybookingsData()
    },[])
 
    const getMybookingsData=()=>{
     Axiosinstance.get('/users/getMybookingsDat').then((res)=>{
         setBokings(res.data)
          
    }).catch((err)=>{
      console.log(err);
      if (err.response.data.message==='unauthorized user')
      { localStorage.clear()
         navigate('/')
   }
     })
    }

    
  return (
    
    <div>
      {bokings.map((booking)=><ButtonList bookingData={booking}/>)}
    </div>
     
  )
}

export default Mybooking
